import React from "react";
import axios from "axios";
import { useState } from "react";
import { TextField, Button, Box, Typography } from '@mui/material';

const api_url = "/apis/predict/";
const Stressometer = () => {
  const [currentStep, setCurrentStep] = useState(1);

  const [formValues, setFormValues] = useState({
    anxiety_level: "",
    self_esteem: "",
    mental_health_history: "",
    depression: "",
    headache: "",
    blood_pressure: "",
    sleep_quality: "",
    breathing_problem: "",
    noise_level: "",
    living_conditions: "",
    safety: "",
    basic_needs: "",
    academic_performance: "",
    study_load: "",
    teacher_student_relationship: "",
    future_career_concerns: "",
    social_support: "",
    peer_pressure: "",
    extracurricular_activities: "",
    bullying: "",
  });
  const totalSteps = 20;
  const [result, setResult] = useState(null);

  // const handleChange = (event) => {
  //     setFormData({...formData,[event.target.name]:event.target.value});
  // }
  const handleChange = (event) => {
    const { name, value } = event.target;
    setFormValues((prevValues) => ({
      ...prevValues,
      [name]: value,
    }));
  };
  const handleNext = () => {
    setCurrentStep((prevStep) => prevStep + 1);
  };
  const handlePrevious = () => {
    setCurrentStep((prevStep) => prevStep - 1);
  };
  const handleSubmit = async (event) => {
    event.preventDefault();

    try {
      const response = await axios.post(api_url, formValues);
      setResult(response.data);
      console.log("Prediction:", response.data.result);
    } catch (e) {
      console.log(e);
    }
  };
  const renderFormStep = () => {
    switch (currentStep) {
      case 1:
        return (
          <div>
            <label htmlFor="anxiety_level" className="form-label">
              Anxiety Level
            </label>
            <input
              type="number"
              id="anxiety_level"
              name="anxiety_level"
              value={formValues.anxiety_level}
              onChange={handleChange}
              className="form-control"
            />
          </div>
        );
      case 2:
        return (
          <div>
            <label htmlFor="self_esteem" className="form-label">
              Self Esteem
            </label>
            <input
              type="number"
              id="self_esteem"
              name="self_esteem"
              value={formValues.self_esteem}
              onChange={handleChange}
              className="form-control"
            />
          </div>
        );
      case 3:
        return (
          <div>
            <label htmlFor="mental_health_history" className="form-label">
              Mental Health History
            </label>
            <input
              type="number"
              id="mental_health_history"
              name="mental_health_history"
              value={formValues.mental_health_history}
              onChange={handleChange}
              className="form-control"
            />
          </div>
